import React from "react";
import { ImageBackground, StyleSheet, Text, View, Button } from "react-native";

const LandingPage = () => (
  <View style={styles.container}>
    <Text>Hi there</Text>
  </View>
);

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
});

export default LandingPage;
